    false,nt"url": null,nt"notes": "This map shows the average rate of change
    in total snowfall from 1930 to 2007 at 419 weather stations in the contiguous 48
    states. Blue circles represent increased snowfall; red circles represent a decrease.
    This indicator also shows the percentage change in winter snow-to-precipitation
    ratio from 1949 to 2015 at 265 weather stations in the contiguous 48 states. This
    ratio measures what percentage of total winter precipitation falls in the form of
    snow. A decrease (red circle) indicates that more precipitation is falling in the
    form of rain instead of snow. Yellow indicates streams with no significant change.
    For more information: www.epa.gov/climatechange/science/indicators Data were provided
    by Dr. Kenneth Kunkel of NOAAu2019s Cooperative Institute for Climate and Satellites.
    For more information: www.epa.gov/climatechange/science/indicators",nt"license_title":
